    describe('PUT /location/:id', () => {

        it('should return 401 when not authenticated', (done) => {
            request(app.getHttpServer())
                .put('/location/' + existingLocation.id)
                .then(res => {
                    expect(res.statusCode).toBe(401)
                    done()
                })
                .catch(err => done(err))

        })

        it('should return 404 when location doesn\'t exist', (done) => {

            const locationUpdate: UpdateLocationDto = {
                address: 'Prešernova ulica, Slovenj Gradec',
                lat: 22.23123,
                lng: 12.23232,
            }


            request(app.getHttpServer())
                .put('/location/a0eebc99-9c0b-4ef8-bb6d-6bb9bd380a20')
                .set('Authorization', `Bearer ${accessToken}`)
                .send(locationUpdate)
                .then(res => {
                    expect(res.statusCode).toBe(404)
                    done()
                })
                .catch(err => done(err))

        })

        it('should return 403 when location was added by another user', (done) => {
            const locationUpdate: UpdateLocationDto = {
                address: 'Prešernova ulica, Slovenj Gradec',
                lat: 22.23123,
                lng: 12.23232,
            }

            request(app.getHttpServer())
                .put('/location/' + existingLocation.id)
                .auth(accessToken, { type: 'bearer' })
                .send(locationUpdate)
                .then(res => {
                    expect(res.statusCode).toBe(403)
                    done()
                })
                .catch(err => done(err))

        })

        it('should return 200 and updated location object', (done) => {
            const location = existingUser.locations[0]
            const locationUpdate: UpdateLocationDto = {
                address: 'Prešernova ulica, Slovenj Gradec',
                lat: 22.23123,
                lng: 12.23232,
            }
            const result = {
                ...location,
                address: locationUpdate.address,
                lat: locationUpdate.lat,
                lng: locationUpdate.lng,
                createdDate: location.createdDate.toISOString()
            }

            request(app.getHttpServer())
                .put('/location/' + location.id)
                .set('Authorization', `Bearer ${accessToken}`)
                .send(locationUpdate)
                .then(res => {
                    expect(res.statusCode).toBe(200)
                    expect(res.body).toMatchObject(result)
                    done()
                })
                .catch(err => done(err))
        })
    })

    function expectLocationEntity(location: any){
        expect(location).toHaveProperty('id')
        expect(location).toHaveProperty('address')
        expect(location).toHaveProperty('lat')
        expect(location).toHaveProperty('lng')
        expect(location).toHaveProperty('imageUrl')
        expect(location).toHaveProperty('createdDate')
        expect(location).toHaveProperty('user')
        expect(location).toHaveProperty('guessess')
    }

    describe('GET /location/random', () => {
        it('should return 200 and a location object', (done) => {
            request(app.getHttpServer())
                .get('/location/random')
                .then(res => {
                    expect(res.statusCode).toBe(200)
                    expectLocationEntity(res.body)
                    done()
                }).catch(err => done(err))

        })

        it('should return at least 3 different object out of 10 request', (done) => {
            const requestsList: Promise<LocationEntity>[] = []
            for (let i = 0; i < 10; i++) {
                requestsList.push(
                    request(app.getHttpServer())
                        .get('/location/random')
                        .then(res => res.body as LocationEntity))
            }

            Promise.all(requestsList).then(res => {
                const uniqueLocations = new Set(res.map(location => location.id))
                expect(uniqueLocations.size).toBeGreaterThanOrEqual(3)
                done()
            }, err => done(err)).catch(err => done(err))
        })
    })

